import React from "react";
import Title from './ComponentWeather/Title';
import Form from './ComponentWeather/Form';


const API_KEY = "cd145d87dcca3f37dda7707b8047db95";

//getWeather={this.getWeather}
class App extends React.Component {

  getWeather = async(e) => {
    e.preventDefault();
      const api_call = await fetch('//http://api.openweathermap.org/data/2.5/forecast?q=Singapore,SG&appid=cd145d87dcca3f37dda7707b8047db95');

      const data= await api_call.json();
      console.log(data);
  } 

  render(){
    return (
      <div>
        <Title/>
        <Form getWeather={this.getWeather}/> 
        </div>     
      );
  }
}

export default App;
